import React from 'react'
import { Link } from 'react-router-dom'

class NavBar extends React.Component{
    state = {active: 'welcome'}
    render() {
        return (
            <div id="navbar">
                <span id="title">minhee kang</span>
                <div>
                    <Link to="/welcome" onClick={this.setState({active: 'welcome'})} >welcome</Link> 
                    <Link onClick={this.setState({ active: 'work' })}to="/work" >work</Link>
                    <Link onClick={this.setState({ active: 'contact' })}to="/contact" >contact</Link>
                    <Link onClick={this.setState({ active: 'about' })}to="/about" >about</Link>
                </div>
            </div>
        )
    }
}

export default NavBar
